<script language=javascript>

var _gMIMETYPE 		= "application/x-jxmailenterprise";
var _gPluginStyle = "margin:0px 0px 0px 0px;padding:0px 0px 0px 0px;border:none 0px;width:100%;height:100%;background-color:#FFFFFF;";

var _gCLSID = "clsid:A56A1518-A259-4109-98B3-06A30F09AB1B";
var _gCodeBase = "https://srtk.hometax.go.kr/JXmailActiveX_2.cab#version=1,0,0,33"; //ActiveX URL 및 버전

var _gPluginVersion = "1.0.0.1";
var _gPluginBinary = "https://srtk.hometax.go.kr/JXMailEnterprisePlugin.exe" //플러그인 다운로드 URL




function createActiveX()
{
  var str = "";

  str = '<object id="JXCEAL" classid="'+_gCLSID +'" codebase="'+_gCodeBase+'" width="100" height="24" border=0>';
  str += '  <PARAM NAME="JSmailAlwaysMenu" value="OFF">';
  str += '  <PARAM NAME="JSmailMenuPrint" value="ON">';
  str += '  <PARAM NAME="JSmailWindowTitle" value="보안메일">';
  str += '  <PARAM NAME="JXViewType" value="CREATE_IE">';      
  str += '  <PARAM NAME="JSmailUseUTF8" value="ALL_UTF8">';
//  str += '  <PARAM NAME="JSPassDlgType" value="PASSDLG2">';
//  str += '  <PARAM NAME="JSTitleBarURL" value="http://mail.creeder.co.kr/jenf/title_logo.jpg">';

  
      	 

  str +='</object>';

  document.write(str);

}


function createPlugin()
{
  var str = "";
  str = '<embed type="'+_gMIMETYPE+'" width="100%" height="90%" style="'+_gPluginStyle+'" id="JXCEAL"></embed>';

	setBodyStyle();
  document.write(str);

}



function checkMozilla()
{
	if(isMozilla() == false) {
		document.location.href = DEFAULT_URL;
		return false;
	}
	return true;
}


function isMozilla() {
    if (navigator.appName == 'Netscape' || navigator.appName == 'Opera') return true;
    return false;
}

function getBrowserInfo() {
    var browserInfo = ["", -1];
    var browserName = "";
    var browserVersion = -1;
    var index = -1;
    var tmp = "";
    try {
        if (navigator.userAgent.lastIndexOf("Navigator") > 0) { //Firefox
            browserInfo[0] = "Navigator";
            index = navigator.userAgent.lastIndexOf(browserInfo[0])+browserInfo[0].length+1;
            tmp = navigator.userAgent.substring(index);
            browserInfo[1] = tmp;
        }
        else if (navigator.userAgent.lastIndexOf("Firefox") > 0) {
            browserInfo[0] = "Firefox";
            index = navigator.userAgent.lastIndexOf(browserInfo[0])+browserInfo[0].length+1;
            tmp = navigator.userAgent.substring(index);
            browserInfo[1] = tmp;
        }
        else if (navigator.userAgent.lastIndexOf("Chrome") > 0) { //Safari
            browserInfo[0] = "Chrome";
            index = navigator.userAgent.lastIndexOf(browserInfo[0])+browserInfo[0].length+1;
            tmp = navigator.userAgent.substring(index);
            index = tmp.indexOf(" ");
            browserInfo[1] = tmp.substring(0, index);
        }
        else if (navigator.userAgent.lastIndexOf("Safari") > 0 && navigator.userAgent.lastIndexOf("Version") > 0) {
            browserInfo[0] = "Safari";
            index = navigator.userAgent.lastIndexOf("Version")+"Version".length+1;
            tmp = navigator.userAgent.substring(index);
            index = tmp.indexOf(" ");
            browserInfo[1] = tmp.substring(0, index);
        }
        else if (navigator.userAgent.lastIndexOf("Opera") > -1 && navigator.userAgent.lastIndexOf("Version") > 0) {
            browserInfo[0] = navigator.appName;
            index = navigator.userAgent.lastIndexOf("Version")+"Version".length+1;
            tmp = navigator.userAgent.substring(index);
            browserInfo[1] = tmp;
        }
        else {
            browserInfo[0] = navigator.appName;
            index = navigator.userAgent.indexOf("/")+1;
            tmp = navigator.userAgent.substring(index);
            index = tmp.indexOf(" ");
            browserInfo[1] = tmp.substring(0, index);
        }
    }
    catch(err) {
    }
    
    return browserInfo;
}


function getPluginInfo()
{
	var plugins = navigator.plugins;
	if(plugins == null || plugins.length == 0)
	{
		return null;
	}

	for(var i=0;i<plugins.length;i++)
	{
	
	  var type = plugins[i][0].type;
	  if(type == _gMIMETYPE)
	  {
//	    alert(plugins[i][0].enabledPlugin.description);
//	    alert(plugins[i].description);
	    return plugins[i];
    }
	}
	return null;
}



function isIE()
{
	var info = getBrowserInfo();
	if(info[0] == "Microsoft Internet Explorer")
		return true;
		
		
	return false;
}

function setBodyStyle()
{
	document.body.style.margin="0px 0px 0px 0px";
	document.body.style.padding="0px 0px 0px 0px";

}


function downloadBinary() {
	location.href = _gPluginBinary;
}

function isOldVersionInstalled()
{
  var info = getPluginInfo();
  var desc = info.description;
  
  var InstalledStr = info.description.match(/([\d.]+)/);
  var InstalledVerArray = InstalledStr[0].match(/([\d])/g);

  var NewVerArray = _gPluginVersion.match(/([\d])/g);
  
  
  for (var i = 0; i < InstalledVerArray.length; ++i) 
  {
    if (NewVerArray.length == i)
    {
      return false;
    }
        
    if (InstalledVerArray[i] == NewVerArray[i]) 
    {
      continue;
    }
    else if (InstalledVerArray[i] > NewVerArray[i]) 
    {
      return false;
    }
    else 
    {
      return true;
     }
  }
    
  if (InstalledVerArray.length != NewVerArray.length) 
  {
    return true;
  }
    
  return false;
}
function isInstalledPlugin()
{
	if(getPluginInfo() == null)
	{
//	  alert("Plugin is not Installed");
		return false;
	}
	
//	alert("Plugin is installed");
	return true;
}

function CheckRun()
{

  if(isIE())
  {
    createActiveX();
    return;
  }
  
  if(isInstalledPlugin())
  {
    if(isOldVersionInstalled())
    {
      //플러그인 설치페이지로
//      alert("Plugin is installed but is old version");
      downloadBinary();
    }
    else
    {
//      alert("Plugin is installed and is new version");
      createPlugin();
    }
  }
  else
  {
    //플러그인이 설치가 안되어 있을때
//      alert("Plugin is not installed");
      downloadBinary();
  }
}
</script>
